    public static String calcSigStar(double fstat, int df1, int df2) {
        int eDf2 = Math.min(df2, maxN);
        int eDf1 = Math.min(df1, maxK);

        if (fstat > cv001[eDf2-1][eDf1-1]) {
            return "***";
        }
        if (fstat > cv01[eDf2-1][eDf1-1]) {
            return "**";
        }
        if (fstat > cv05[eDf2-1][eDf1-1]) {
            return "*";
        }
        return "";
    }
